const initialState = {
    error: null,
    registrationStatus: null,
  };
  
  const registrationReducer = (state = initialState, action) => {
    switch (action.type) {
      case 'SET_ERROR':
        return {
          ...state,
          error: action.payload,
        };
      case 'SET_REGISTRATION_STATUS':
        return {
          ...state,
          registrationStatus: action.payload,
        };
      default:
        return state;
    }
  };
  
  export default registrationReducer;
